import React, { useState, useContext } from 'react';
import Context from './../context.js';

import IfEmpty from './mainPages/IfEmpty.js';
import IfExists from './mainPages/IfExists.js';
import IfNotExists from './mainPages/IfNotExists.js';

function Main(){

    const {userData} = useContext(Context);

    console.log(userData)

    return(
        <main className="main">
            <div className="container">
                <div className="main-wrapper">
                    {userData === null || userData === '' ? <IfEmpty /> : (userData.message === undefined ? <IfExists /> : <IfNotExists />)}
                </div>
            </div>
        </main>
    );
}

export default Main;
